import React from 'react';
import './index.css';

class MainMenu extends React.Component {

    render() {
        return (
            <nav className="main_navi">
                <ul className="main_ul">
                    <li><a className="navi_item" href="#">Home</a></li>
                    <li><a className="navi_item" href="#">Our Apartment</a></li>
                    <li><a className="navi_item" href="#">Maledives</a></li>
                    <li><a className="navi_item" href="#">Contact</a></li>
                    <li><a className="navi_item" href="#">Book</a></li>
                </ul>

            </nav>
        );
    }
}




export default MainMenu;
